import { BrowserRouter, Routes, Route } from "react-router-dom";
import LandingPage from "";
const Router = () => {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" component={LandingPage} />
      </Routes>
    </BrowserRouter>
  );
};

export default Router;
